      let i = 0
      this.$nextTick(() => {
        for (let y of document.getElementsByClassName('talk-he')) {
          if (this.talklist[i].name === 'me') {
            y.getElementsByClassName('talk-img')[0].className += ' talk-right'
            y.getElementsByClassName('talk-text')[0].className += ' talk-right'
            y.getElementsByClassName('talk-mao')[0].className += ' talk-right'
          }
          i++
        }
      })
    },
    beforeRouteLeave (to, from, next) {
      this.$parent.title = ''
      next()
    },
    methods: {
      gettalk(msg){
        this.talktext = msg
      },
      subtalk(){
        this.talklist.push({
          'name': 'me',
          'headimg': 'data:image/jpeg;base64,',
          'text': this.talktext
        })
        document.getElementsByClassName('talk-input')[0].focus()
        this.talktext = ''
        let i = 0
        this.$nextTick(() => {
          for (let y of document.getElementsByClassName('talk-he')) {
            if (this.talklist[i].name === 'me') {
              y.getElementsByClassName('talk-img')[0].className += ' talk-right'
              y.getElementsByClassName('talk-text')[0].className += ' talk-right'
              y.getElementsByClassName('talk-mao')[0].className += ' talk-right'
